import Container from 'react-bootstrap/Container';
import Navbar from 'react-bootstrap/Navbar';
import image from "./logo.jpeg";

export function NavBar() {
    return (
        <>
            <Navbar bg="dark" variant="dark">
                <Container>
                    <Navbar.Brand href="#home">
                        <img
                            alt=""
                            src={image}
                            height="30"
                            width="30"
                        />
                        Subtitles Generator
                    </Navbar.Brand>
                </Container>
            </Navbar>
        </>
    )
}
